import React from 'react'

import { useForm } from 'react-hook-form'

import { useNavigate } from 'react-router-dom'

import PropTypes from 'prop-types'
import Tabs from '@mui/material/Tabs'
import Tab from '@mui/material/Tab'
import Typography from '@mui/material/Typography'
import Box from '@mui/material/Box'
import { Button } from '@material-ui/core'
import { Info } from '@material-ui/icons'

import {
    LivingPlaceRegistrationTimeline,
    RoomInformations
} from '../Components/Registration/index'

import { useData } from '../Context/DataContext'

import '../Styles/Pages/LivingPlaceRegistrationLivingPlacesInformations.scss'

function TabPanel(props) {
    const { children, value, index, ...other } = props

    return (
        <div
            role='tabpanel'
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box sx={{ p: 3 }}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    )
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
}

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    }
}

const LivingPlaceRegistrationLivingPlacesInformations = () => {

    const [value, setValue] = React.useState(0)

    const handleChange = (event, newValue) => {
        setValue(newValue)
    }

    const { setValues, data } = useData()

    console.log('data look inside', data)

    const { register, handleSubmit, errors } = useForm({
        defaultValues: {
            living_place_informations: []
        }
    })

    const navigate = useNavigate()

    const onSubmit = (data) => {
        navigate('/living_place_registration/send_datas')
        setValues(data)
        console.log(data)
    }

    const previewStep = (data) => {
        navigate('/living_place_registration/rooms_informations')
        setValues(data)
        console.log(data)
    }

    return (
        <>
            <form
                onSubmit={handleSubmit(onSubmit)}
                className='timelineFrom__container'
            >
                <LivingPlaceRegistrationTimeline />
                <h5>Living place informations</h5>

                <Box sx={{ width: '100%' }}>
                <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                    <Tabs value={value} onChange={handleChange} aria-label='basic tabs example' centered>
                        <Tab label='Item One' {...a11yProps(0)} />
                        <Tab label='Item Two' {...a11yProps(1)} />
                        <Tab label='Item Three' {...a11yProps(2)} />
                    </Tabs>
                </Box>
                <TabPanel value={value} index={0}>
                    <LivingPlaceInformations />
                </TabPanel>
                <TabPanel value={value} index={1}>
                    <LivingPlaceInformations />
                </TabPanel>
                <TabPanel value={value} index={2}>
                    <LivingPlaceInformations />
                </TabPanel>
                </Box>

                <div id='livingPlacesInformationsButtons__div'>
                    {/* PREVIEW */}
                    <Button
                        type='submit'
                        variant='contained'
                        style={{
                            backgroundColor: '#5398D4',
                            borderRadius: 50,
                            fontFamily: 'DMSansMedium',
                            boxShadow: 'unset'
                        }}
                        onClick={previewStep}
                    >
                        Preview
                    </Button>

                    {/* NEXT */}
                    <div id='livingPlacesInformationsNextButton__div'>
                        <Info style={{ color: '#eeeeee' }}/>
                        <Button
                            type='submit'
                            variant='contained'
                            style={{
                                backgroundColor: '#5398D4',
                                borderRadius: 50,
                                fontFamily: 'DMSansMedium',
                                boxShadow: 'unset',
                                marginLeft: '10px'
                            }}
                        >
                            Next
                        </Button>
                    </div>
                </div>
            </form>
        </>
    )
}

const textFieldStyle = {
    width: '290px',
    height: '40px',
    borderRadius: '5px',
    background: '#eee',
    paddingLeft: '15px',
    paddingTop: '5px'
}

const descriptionFieldStyle = {
    width: '600px',
    height: '120px',
    borderRadius: '5px',
    background: '#eee',
    paddingLeft: '15px',
    paddingTop: '5px'
}

const smallTextFieldStyle = {
    width: '140px',
    height: '40px',
    borderRadius: '5px',
    background: '#eee',
    paddingLeft: '15px',
    paddingTop: '5px'
}

const maximumStayDuration__array = [
    {
        value: 'short_stay',
        label: 'Short stay'
    },
    {
        value: 'long_stay',
        label: 'Long stay'
    }
]

const rentalPriceTerm__array = [
    {
